import React from 'react'
import CheckboxInput from '../../components/ui/CheckboxInput'
import useFormContext from '../../Hooks/useFormContext'

const AgreementsInfo = () => {
  const { userData, handleChange, commonInputSetContainerClasses, commonStepFormContainerClasses } = useFormContext()

  const mlhCoCLabelText = <span>
    I have read and agree to the MLH Code of Conduct, which can be found at <a href="https://static.mlh.io/docs/mlh-code-of-conduct.pdf" target="_blank" rel="noopener noreferrer"> MLH Code of Conduct</a >
  </span>

  return (
    <div className={commonStepFormContainerClasses}>
      <CheckboxInput containerClass=""
        labelClass="normal-case w-min align-top"
        inputClass="inline w-min"
        labelText={mlhCoCLabelText}
        fieldName="mlhCoCAgree"
        fieldValue={userData.firstName}
        handleChange={handleChange}
      />
    </div>
  )
}

export default AgreementsInfo
